import React from "react"
import emily from "../../assests/images/image-emily.jpg"

const ClientsReport = () => {
  return(
    <div className="text-center">
      <img className="mx-auto rounded-full w-20" src={emily} alt="woman with long brown hair"/>
      <p className="py-8 px-4 text-gray-600 font-sa">We put our trust in Sunnyside and they delivered, making sure our needs were met and deadlines were always hit.</p>
      <p className="font-serif font-bold text-gray-900 text-lg">Emily R.</p>
      <p className="text-gray-500 font-sans pt-3 pb-14 text-sm">Marketing Director</p>
    </div>
  )
}
export default ClientsReport
